    useEffect(() => {
    Axios.get('http://localhost:3001/news').then((res)=>{
        setNews(res.data);
    })
    }, [news])
    return(
        <div className='newsbody'>
            <div className='newsbody-container'>
                <NewsHeader news={news}/>
                <div className='newsbody-nav'>
                    <div className='nav-item'></div>
                    <div className='nav-item'></div>
                    <div className='nav-item'></div>
                    <div className='nav-item'></div>
                </div>
            </div>
        </div>
    )
}
